description:
Kagney Linn Karter has had a rough day at the bar where she works. It seems that everyone who entered the bar that day was either named Paul or Pauline. Her final patron of the night is ready to leave since his wife stood him up, but Kagney can't seem to find his ID which she was holding for him. She feels terribly sorry for the mistake and is willing to find a way to make it up to him. Since he was stood up by his wife, Kagney decides that the best way to make it up to him is by fucking his brains out in the middle of the bar.

